【画像】<br>
★イメージ写真です。<br>
<br>
【お届け／納期】<br>
★メーカーさんに在庫がある場合は、注文確定日～５営業日の一番早く出荷が出来る日の出荷になるように努力いたします。<br>
但し、お支払い方法が銀行振込みの場合は、入金確認後の出荷となります。<br>
★メーカーさんに在庫が無い場合は、発送までにお時間を要する場合がございます。<br>
お届け納期は、改めてこちらから発送日をご連絡いたします。<br>
★商品により納期は,まちまちですが、目安としては約２週間程～です。ご参考にしてください。<br>
★お急ぎのお客様は、ご注文前にお電話等でお問い合わせを願います。その時点で納期をお調べいたします。<br><br>
【お取り寄せ商品について】<br>
★メーカーさんからのお取り寄せ商品は、在庫状況、納期は常時変動しております。商品によっては、仕様変更中など長期納期がかかる物もございます。その場合は、メーカーさんへ予約となります。<br>
★商品によっては、メーカーさんの生産終了、廃盤等の理由でせっかくご注文いただいてもご用意できない場合がございます。その場合は、弊社よりメールにてご連絡差し上げて、キャンセル処理をさせて頂きます。予めご了承願います。<br><br>



【送料／手数料】<br>
★送料込みの商品は、価格に送料を含んでおります。<br>
★送料別の商品は、全国一律・送料￥1,050－です。<br>
★但し、全ての商品で、沖縄・離島・一部地域のお客様は送料「着払い」とさせて頂いております。<br>
★代引き手数料は、一律￥420-です。<br>
★銀行振込の手数料は、お客様のご負担でお願いいたします。<br><br>




【取り付け】<br>
★お取付が出来る様に、取り付け取り扱い説明書及び取り付け備品は同梱してあります。<br>
★個人様で取り付けは、技術的に個人差がありますので、最寄のショップ様や板金工場様等のお取付をお勧めいたします。<br>
★適応車型：ＧＸ・16Ｓワゴン・2Ｒ・3Ｒ（ヘッドレスト付車用）<br>
★＜ＢＬＥＳＳ＞ブレス　クリエイション製<br>
★クールブラックの合成皮革製<br>
★中央の背中と座面は、ムレ・滑りを抑制するように小さい穴が開いたパンチング加工です。<br>
★＜ＢＬＥＳＳ＞の型押しによるブランドネーム入り<br>
★フロントシートは、背中にポケット付き<br>
★ＮＶ200がスポーティにグレードアップします。<br>
★純正用品同等の品質レベルで、安心してご購入して頂けます。<br><style type="text/css">

